import { createStore } from 'vuex';

export default createStore({
  state: {
    count: 0,
    app:{
        name: 'Vue AdminLTE',
    }
  },
  mutations: {
    increment(state) {
      state.count++;
    },
  },
  actions: {
    increment({ commit }) {
      commit('increment');
    },
  },
  modules: {},
});
